import React, {Component} from 'react'
import Adminlist1 from './Adminlist1' 
import axios from 'axios'

class Menu extends Component {
    
    constructor(){
        super();
        this.state = {
            items: [],
        }
    }


    componentDidMount() {
        
        axios.get('http://localhost:5000/admin/findall',
        // axios.get('admin/findall',
        {
            headers: {
              'auth-token': localStorage.usertoken
            }},
        )
         .then(res => {
             console.log(res)
             this.setState({items: res.data})
         })
    }
    
    render() {
        
        const arr = this.state.items.map( (item, index) => {
	
            return <Adminlist1 
                     _id={item._id}
                     itemId={item.itemId}
                     catogaryName={item.catogaryName}
                     subcategaryName={item.subcatogaryName}
                     price={item.price} 	
                />
        
        } )
        
        return (

            <div>
            <div className="main-footer" style={{ marginTop:'3%', height:'auto', width:'auto' }}>
            <div className="container" style={{ height:'auto', width:'auto' }}>
                {/* <div className="row" style={{marginTop:'3%', height:'auto', width:'auto'}}>
                   {arr} 
                </div> */}
                <Table >
                    <thead>
                        <tr style={{width:'100%'}}>
                        <th style={{width:'20%'}}>Item Id</th>
                        <th style={{width:'20%'}}>Item Name</th>
                        <th style={{width:'20%'}}>catogaryName</th>
                        <th style={{width:'20%'}}>catogaryName</th>
                        <th style={{width:'20%'}}>catogaryName</th>
                        </tr>
                    </thead>
                </Table>
            </div>
            </div>
    
            </div>
        )
    }
}
    



export default Menu;
